## Model 1 - Auto ARIMA


::: {.cell hash='index_cache/html/unnamed-chunk-7_77c5d8f5b395c9aa37aca9138c53c8af'}

```{.r .cell-code}
model_spec_arima <- arima_reg() %>%
    set_engine("auto_arima")

wflw_fit_arima <- workflow() %>%
    add_model(model_spec_arima) %>%
    add_recipe(recipe_spec %>% step_rm(all_predictors(), -mes)) %>%
    fit(training(splits))
```
:::


## Model 2 - Prophet


::: {.cell hash='index_cache/html/unnamed-chunk-8_1ef619c2a65db655bd4a83d85e5cf717'}

```{.r .cell-code}
model_spec_prophet <- prophet_reg() %>%
    set_engine("prophet")

wflw_fit_prophet <- workflow() %>%
    add_model(model_spec_prophet) %>%
    add_recipe(recipe_spec %>% step_rm(all_predictors(), -mes)) %>%
    fit(training(splits))
```
:::


## Model 3 - Elastic Net


::: {.cell hash='index_cache/html/unnamed-chunk-9_9a65daa8b8e844b0fc70b9eb72a50c60'}

```{.r .cell-code}
model_spec_glmnet <- linear_reg(
    mixture = 0.9,
    penalty = 4.36e-6
) %>%
    set_engine("glmnet")

wflw_fit_glmnet <- workflow() %>%
    add_model(model_spec_glmnet) %>%
    add_recipe(recipe_spec %>% step_rm(mes)) %>%
    fit(training(splits))
```
:::


## Modeltime Workflow for Ensemble Forecasting

## Step 1 - Create a Modeltime Table


::: {.cell hash='index_cache/html/unnamed-chunk-10_6c81a5f9c66eb5ce4fced5649630feb5'}

```{.r .cell-code}
m750_models <- modeltime_table(
    wflw_fit_arima,
    wflw_fit_prophet,
    wflw_fit_glmnet
)

m750_models
```

